s.\r\n</p>\r\n\r\n<p>\r\nIs dining and shopping your passion?  Take a five minute drive to Old Koloa Town and beyond to Poipu with numerous local shopping venues.  The south side is noted for its excellent dining with restaurants representing all cultures.  No matter what type of food you are craving, you won\'t have to travel far in any direction to find your desire.\r\n</p>\r\n\r\n<p>\r\nThe Boulay Inn is a smoke free property.\r\n</p>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:1091:\"<p>Nestled in rural Omao on the south side of Kauai is the Boulay Inn.  It is your own secluded home away from home.  Tastefully decorated in island style decor, you will find more than ample room to enjoy your home on Kauai.  The entry is off Omao Road into the Boulay hale (home).</p>\n<p>Omao is truly the hub of the wheel in terms of location for all east, west and south side activities, shopping and dining.  The Boulay Inn is just minutes away from Poipu Beach where you will find sunshine, diving, boogie boarding or snorkeling, and we will provide you with beach accessories at no extra charge.  If golf is your game, there are three beautiful courses within a 15 minute radius.</p>\n<p>Is dining and shopping your passion?  Take a five minute drive to Old Koloa Town and beyond to Poipu with numerous local shopping venues.  The south side is noted for its excellent dining with restaurants representing all cultures.  No matter what type of food you are craving, you won\'t have to travel far in any direction to find your desire.</p>\n<p>The Boulay Inn is a smoke free property.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1442024596,1),('field:node:3','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:1032:\"<p>\r\nThe bedroom has a queen size bed and the living room in the home is airy and comfortable. Your bathroom has a shell design in the ceramic tile shower with green and verdant yard just outside the window.\r\n</p>\r\n\r\n<p>\r\nWe have tried to think of everything that you might possibly need or want in your island home. Cooking facilities are available for your use.  Listen to the stereo. Watch a movie on the VCR or just indulge in the cable television. The home is wonderfully ventilated, with a combination of ceiling fan and sliding glass doors, in the living room and onto the spacious backyard lanai. We don\'t want our guests to spend any of their Hawaiian vacation in a laundromat, so washer and dryer facilities are also available. \r\n</p>\r\n\r\n<p>\r\n  At a glance:\r\n</p>\r\n<ul>\r\n  <li>One bedroom</li>\r\n  <li>Sleeps 2-4</li>\r\n  <li>Queen bed</li>\r\n  <li>Convertible sofa bed</li>\r\n  <li>Hawaiian shell design tile shower</li>\r\n  <li>Bathtub</li>\r\n  <li>Smoke free property</li>\r\n  <li>Luscious green fenced backyard</li>\r\n</ul>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:991:\"<p>\nThe bedroom has a queen size bed and the living room in the home is airy and comfortable. Your bathroom has a shell design in the ceramic tile shower with green and verdant yard just outside the window.\n</p>\n<p>\nWe have tried to think of everything that you might possibly need or want in your island home. Cooking facilities are available for your use.  Listen to the stereo. Watch a movie on the VCR or just indulge in the cable television. The home is wonderfully ventilated, with a combination of ceiling fan and sliding glass doors, in the living room and onto the spacious backyard lanai. We don\'t want our guests to spend any of their Hawaiian vacation in a laundromat, so washer and dryer facilities are also available. \n</p>\n<p>\n  At a glance:\n</p>\n<ul><li>One bedroom</li>\n<li>Sleeps 2-4</li>\n<li>Queen bed</li>\n<li>Convertible sofa bed</li>\n<li>Hawaiian shell design tile shower</li>\n<li>Bathtub</li>\n<li>Smoke free property</li>\n<li>Luscious green fenced backyard</li>\n</ul>\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,144202