INSERT INTO `field_data_body` VALUES ('node','page',0,1,1,'und',0,'Visit the <a href=\"http://www.vrbo.com/111410\">Boulay Inn VRBO page</a> for more information','','filtered_html'),('node','page',0,3,3,'und',0,'<p>\r\nThe bedroom has a queen size bed and the living room in the home is airy and comfortable. Your bathroom has a shell design in the ceramic tile shower with green and verdant yard just outside the window.\r\n</p>\r\n\r\n<p>\r\nWe have tried to think of everything that you might possibly need or want in your island home. Cooking facilities are available for your use.  Listen to the stereo. Watch a movie on the VCR or just indulge in the cable television. The home is wonderfully ventilated, with a combination of ceiling fan and sliding glass doors, in the living room and onto the spacious backyard lanai. We don\'t want our guests to spend any of their Hawaiian vacation in a laundromat, so washer and dryer facilities are also available. \r\n</p>\r\n\r\n<p>\r\n  At a glance:\r\n</p>\r\n<ul>\r\n  <li>One bedroom</li>\r\n  <li>Sleeps 2-4</li>\r\n  <li>Queen bed</li>\r\n  <li>Convertible sofa bed</li>\r\n  <li>Hawaiian shell design tile shower</li>\r\n  <li>Bathtub</li>\r\n  <li>Smoke free property</li>\r\n  <li>Luscious green fenced backyard</li>\r\n</ul>\r\n','','full_html'),('node','page',0,8,8,'und',0,'Leave a comment below','','filtered_html'),('node','page',0,9,9,'und',0,'Rates at the Boulay Inn are:\r\n\r\n$70/night\r\n\r\nExtended stays (over 14 days) get some special rate maybe.','','filtered_html'),('node','page',0,10,10,'und',0,'<p>\r\nNestled in rural Omao on the south side of Kauai is the Boulay Inn.  It is your own secluded home away from home.  Tastefully decorated in island style decor, you will find more than ample room to enjoy your home on Kauai.  The entry is off Omao Road into the Boulay hale (home).\r\n</p>\r\n\r\n<p>\r\nOmao is truly the hub of the wheel in terms of location for all east, west and south side activities, shopping and dining.  The Boulay Inn is just minutes away from Poipu Beach where you will find sunshine, diving, boogie boarding or snorkeling, and we will provide you with beach accessories at no extra charge.  If golf is your game, there are three beautiful courses within a 15 minute radius.\r\n</p>\r\n\r\n<p>\r\nIs dining and shopping your passion?  Take a five minute drive to Old Koloa Town and beyond to Poipu with numerous local shopping venues.  The south side is noted for its excellent dining with restaurants representing all cultures.  No matter what type of food you are craving, you won\'t have to travel far in any direction to find your desire.\r\n</p>\r\n\r\n<p>\r\nThe Boulay Inn is a smoke free property.\r\n</p>\r\n','','filtered_html');
/*!40000 ALTER TABLE `field_data_body` ENABLE KEYS */;
UNLOCK TABLES;

