nim roof party, sartorial freegan XOXO gentrify Williamsburg umami Wes Anderson paleo Tumblr mumblecore flannel. +1 readymade bespoke Marfa typewriter VHS.','filtered_html'),('comment','comment_node_page',0,5,5,'und',0,'hi','filtered_html'),('comment','comment_node_page',0,6,6,'und',0,'comment from admin','filtered_html'),('comment','comment_node_page',0,7,7,'und',0,'I like turtles','filtered_html');
